import React from 'react';
import './FromAirport.scss';

const FromAirport : React.FC = props => {
    return (
        <section className={`from-airport`}>
            <h2>From airport to city center</h2>
            <p>The airport is 35 km away from the city center.</p>

            <h3>From airport to Syntagma (Σύνταγμα) station</h3>
            <h4>Option 1 : Metro</h4>
            <p>Metro 3 (blue line), 50 min, every 30 min (05′ and 35′), 10€ (or 9€ ?)</p>

            <h4>Option 2 : Bus X95</h4>
            <p>Departure is between exits 4 and 5 of arrivals terminal, 40-55 min, 
                every 15-20 min (timetable : <a href='https://www.athensairportbus.com/en/timetable/x95airporttoathensdowntown.html'>here</a> - 19:40, 19:55, 20:10, 20:25, 20:40, 20:55), 
                6€ (or 5.50€ ?), ticket valid only on the express bus</p>

            <h3>From Syntagma (Σύνταγμα) station to our Airbnb</h3>
            <h4>Option 1 : Metro</h4>
            <p>Metro 2 (red line) to Omonia station, 1 stop, 3 min, exit Panepistimiou, 1.20€ if you took the express bus, included in the metro ticket from airport.<br></br>
            Then walk 10 min.</p>

            <h4>Option 2 : Walk 25 min</h4>
        </section>
    );
}

export default FromAirport;
